window.webLeaveConfirm = function(type) {
  if (type === 'customPage') {
    // 个人网页
    let event = new Event('customPage')
    window.dispatchEvent(event) //触发自定义inputChangeEvt事件
  } else if (type === 'marketingPage') {
    // 营销网页
    let event = new Event('marketingPage')
    window.dispatchEvent(event) //触发自定义inputChangeEvt事件
  }
}
// 将图片放在对应的为位置 url图片地址 openid 唯一标识
window.webUploadCallBack = function(url, onlyId) {
  let event = new CustomEvent('correspondingPosition', {
    detail: {
      url: url,
      openid: onlyId
    }
  })
  window.dispatchEvent(event)
}

// 关闭网页，并跳转到指定位置 app方法
window.closePage = function(url) {}
// 调取原生分享 app方法
window.nativeShare = function(shareParams) {}
